import React from "react";
import "./FooterSection.css";
import Facebook from "./images/facebook.png";
import Instagram from "./images/insta.png";
import LinkedIn from "./images/linkedin.png";
import Twitter from "./images/twitter.png";



const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-container">
        {/* Brand or Title */}
        <div className="footer-brand">
          <h2>Team RASPBerry</h2>
          <p>Your one-stop platform for AI-driven conversations, real-time insights, and seamless user experiences with Kyan!</p>
          </div>

        {/* Useful Links Section */}
        <div className="footer-links">
          <div className="links-column">
            <h4>Quick Links</h4>
            <ul>
              <li><a href="#">Home</a></li>
              <li><a href="#">Team</a></li>
              <li><a href="#">Sponsorship</a></li>
              <li><a href="#">Gallery</a></li>
              <li><a href="#">Features</a></li>
              <li><a href="#">Contact</a></li>
            </ul>
          </div>

        </div>

        <div className="footer-social">
        <h4>Follow Us</h4>
          <div className="social-icons">
            <a href="#" aria-label="Facebook"><img src={Facebook}></img></a>
            <a href="#" aria-label="Twitter"><img src={Twitter}></img></a>
            <a href="#" aria-label="Instagram"><img src={Instagram}></img></a>
            <a href="#" aria-label="LinkedIn"><img src={LinkedIn}></img></a>
          </div>
        </div>
      </div>

      {/* Footer Text */}
      <div className="footer-text">
        <p>Â© 2025 Team RASPBerry. All rights reserved. Crafted by SE-07.</p>
      </div>
    </footer>
  );
};

export default Footer;
